import {BrowserRouter,Routes,Route} from 'react-router-dom'
import MainLayout from './layouts/MainLayout';
import HomeScreen from './screens/HomeScreen';

const App = () => {
  return (
    <BrowserRouter>
    <Routes>
     <Route path='/' element={<MainLayout/>}>
       <Route path="" element={<HomeScreen />} />
     </Route>
    </Routes>

    </BrowserRouter>
  );
};

export default App;
